import MainLayout from '../mainlayout';

const CalorieCalculation: React.FC = () => {
  return (
    <MainLayout>
    <div>
      <h1>calorie calculation Page</h1>
      <p>Welcome to the calorie calculation.</p>
    </div>
    </MainLayout>
  );
};

export default CalorieCalculation;
